import Link from 'next/link';
import Layout from '../../layout/layouts';



    class Pembayaran extends React.Component{
    render(){
        return(
            <Layout>
            <span>Pembayaran</span>
            <hr />
            <Link href="/index"><a>kembali ke beranda</a></Link>
            </Layout>
        )
    }
    }
  
    export default Pembayaran;
